import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import { Auth0Provider } from "@auth0/auth0-react";
import { userAuth0 } from "@auth0/auth0-react";
import Home from "./components/Home";
import About from "./components/About";
import Contact from "./components/Contact";
//Importamos el bot贸n de Log in
import { LoginButton } from "./components/Login";
//Importamos el bot贸n de Log out
import { LogoutButton } from "./components/Logout";
//Importamos el profile
import { Profile } from "./components/Profile";

function App() {
  const { isAuthenticated } = useAuth0();
  return (
    <Auth0Provider
      domain="dev-757jqha3ylhymbpr.us.auth0.com"
      clientId="ZtBA3BzChlbiRWpzYd8zfTdQckJPt9nA"
      redirectUri={window.location.origin}
    >
      <Router>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            <li>
              <Link to="/contact">Contact</Link>
            </li>
          </ul>
          {isAuthenticated ? (
            <>
              <Profile />
              <LogoutButton />
            </>
          ) : (
            <LoginButton />
          )}
        </nav>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} />
        </Routes>
      </Router>
    </Auth0Provider>
  );
}

export default App;
